// src/components/Button.js
import React from 'react';

const Button = ({ text, onClick, type, style }) => {
  const baseStyle = "px-8 py-3 rounded-full text-lg transition-all";

  const buttonStyle = style || "bg-blue-500 text-white hover:bg-blue-600";

  return (
    <button
      onClick={onClick}
      type={type}
      className={`${baseStyle} ${buttonStyle}`}
    >
      {text}
    </button>
  );
};

export default Button;
